{"query":"{
  candidato(limit: 1500, filter: {twitter_user: {_nnull: true}}) {
    name
    birthday
    id
  }
}"}

{"query":"{
  campaigns {
    name
    image_cover {
      id
    }
    date_updated
    actions {
      id
      actions_id {
        name
        icon {
          id
        }
      },
      translations {
        languages_code {
          id
          name
        }
        description
        call_to_action_url
        call_to_action_label
      }
    }
  }
}

"}

{"query":"  {
    candidato {
      name
      genre
      age
      partido {
        id
        name
        logo{
          id
        }
        district {
          id
          name
        }
      }
      avatar {
        id
      },
      cargo
      cargos_publicos
      profession {
        name
      }
      childrens
      razon_social
      tipo_societario
      twitter_user
      twitter_tweets
      twitter_profile
      twitter_followers
      twitter_created_at
      twitter_friends
      twitter_verified
      otros_partidos
      distrito_nacional {
        id
        name
      }
    }
  }"}

{"query":"{
  campaigns_translations (filter: {languages_code: {id: {_eq: "en"}}}, sort: ["-campaigns_id"], limit: 6){
    title
    campaign: campaigns_id {
      id
    }
  }
}

"}

{"query":"{
  campaigns {
    id
    name
    image_cover {
      id
    }
    translation: translations(filter: {languages_code: { id: {_eq: "es"}}}, limit: 1){
      title
      short_description
    }
  }
}

"}

{"query":"{
  iniciative {
    id
    barriers_political {
      barriers_id {
        id
        text
      }
    }
  }
}"}

