{"query":"query {
	initiatives_aggregated(filter: {
			_and: [{ _or: [
				{ organizational_barriers: { id: { _nnull: true } } },
			] }]
		}) {
		count {
			id
		}
	}
	initiatives(
		page: 1
		limit: 80
		filter: {
			_and: [{ _or: [
				{ topics: {initiative_topics_id: { id: { _nnull: true } } } },
			] }]
		}
	) {
		id
		initiative_status
		status
		organizational_barriers {
			id
		}
		country {
			hub {
				translations {
					name
				}
			}
			code
			name
			translations {
				name
			}
		}
		topics {
			initiative_topics_id {
				id
				value
				translations {
					name
				}
			}
		}
		organization {
			logo {
				filesize
				filename_download
				id
			}
			name
		}
		start_date
		end_date
	}
}
"}

